{'channelId': 'UCUMZ7gohGI9HcU9VNsr2FJQ', 'videoId': 'n9pbzuUpbGg', 'textDisplay': "Value does not come from work... Work can add value, but people don't farm because they want to work.. Value is highly subjective, for example a glass of water has little value to you right now probably, but imagine being stranded in the desert with no water for days. You'd pay anything. 

The currency is the most traded commodity, for it to be stable it's best if it's something that everyone wants, but is hard to acquire (takes hard work). This way, the growth of the economy is tied to real assets and regular people's savings will earn a real interest rate. The problem is paper allows margin which amplifies speculation - the banks lend claims on nothing - creating them costs them very little,  the people effectively become debt slaves to the banks. Instead of earning interest, their savings are debased through excessive lending.", 'textOriginal': "Value does not come from work... Work can add value, but people don't farm because they want to work.. Value is highly subjective, for example a glass of water has little value to you right now probably, but imagine being stranded in the desert with no water for days. You'd pay anything. 

